import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { getObjectClassNames } from "../design/utils";

const classes: any = getObjectClassNames({
  navContainer: {
    display: "flex",
    alignItems: "center",
    boxShadow: "0px 3px 10px gray",
    height: 100,
    background: "ghostwhite",
    marginBottom: 20,
  },
  navText: {
    display: 'flex',
    width: '15%',
    fontSize: 20,
    fontFamily: "monospace",
    cursor: "pointer",
    "::hover": {
      background: "grey",
    },
    justifyContent: 'center',
    alignItems: 'center',
    height: '100%'

  },
  logo: {
    display: "flex",
    marginLeft: '20%',
    flexDirection: 'row',
    alignItems: 'center'
  }
});

const NavigationBar = () => {
  const navigate = useNavigate();
  return (
    <div className={classes.navContainer}>
      <div className={classes.logo}>
        <img height={40} width={40} src="data:image/png;base64," />
        <text style={{fontWeight: 800, fontStyle: 'italic', fontFamily: 'fantasy', fontSize: 24}}>Bus Reservation</text>
      </div>
      <div className={classes.navText} onClick={() => navigate("/seats")}>
        Seats
      </div>
      <div className={classes.navText} onClick={() => navigate("/dashboard")}>
        Reservation
      </div>
    </div>
  );
};

export default NavigationBar;
